import React from "react";
import { NavigationContainer } from "@react-navigation/native";
import Drawers from "./navigation/drawer";
import {store} from './app/store';
import { Provider } from 'react-redux';


const App = () => {
  return (
    <Provider store={store}>
    <NavigationContainer>
      <Drawers />
    </NavigationContainer>
    </Provider>
  )

}

export default App
